import React from "react";
import {
  Video,
  AlertTriangle,
  ArrowUp,
  ArrowDown,
  ArrowLeft,
  ArrowRight,
  Square,
} from "lucide-react";

const ControlPanel = ({
  videoStream,
  isVideoConnected,
  videoUrl,
  isConnected,
  handleMouseDown,
  handleMouseUp,
  handleTouchStart,
  handleTouchEnd,
  handleStopClick,
}) => {
  return (
    <div className="min-h-screen bg-gray-50 flex flex-col md:flex-row items-start justify-center gap-6 p-6">
      {/* ====== VIDEO PANEL ====== */}
      <div className="flex-1 bg-white rounded-2xl shadow-lg p-4 flex flex-col items-center justify-center">
        <h2 className="text-lg font-semibold text-gray-700 mb-3 self-start">
          Live Camera Feed
        </h2>

        <div className="w-full h-[420px] flex items-center justify-center border border-gray-200 rounded-xl overflow-hidden bg-gray-100">
          {videoStream && isVideoConnected ? (
            <img
              src={videoStream}
              alt="Live Video Feed"
              className="w-full h-full object-cover"
            />
          ) : (
            <div className="flex flex-col items-center justify-center text-center text-gray-600">
              <Video size={48} className="text-gray-400 mb-3" />
              <p className="font-medium">
                {isVideoConnected
                  ? "Connecting to video stream..."
                  : "Live video feed will appear here"}
              </p>
              <small className="text-gray-500 mt-1">
                {videoUrl
                  ? `Stream URL: ${videoUrl}`
                  : "Configure video stream URL in settings"}
              </small>

              {!isVideoConnected && videoUrl && (
                <div className="mt-4 flex items-center gap-2 text-sm text-red-500 font-medium">
                  <div className="w-2 h-2 rounded-full bg-red-500 animate-pulse"></div>
                  Video stream disconnected
                </div>
              )}
            </div>
          )}
        </div>
      </div>

      {/* ====== CONTROL PANEL ====== */}
      <div className="w-full md:w-[340px] bg-white rounded-2xl shadow-lg p-6 flex flex-col items-center">
        <h2 className="text-xl font-semibold text-gray-800 mb-4">
          Vehicle Controls
        </h2>

        <div className="grid grid-cols-3 gap-4">
          {/* Row 1 */}
          <div></div>
          <button
            id="forward"
            onMouseDown={() => handleMouseDown("forward")}
            onMouseUp={() => handleMouseUp("forward")}
            onTouchStart={(e) => handleTouchStart(e, "forward")}
            onTouchEnd={(e) => handleTouchEnd(e, "forward")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowUp className="w-6 h-6" />
          </button>
          <div></div>

          {/* Row 2 */}
          <button
            id="left"
            onMouseDown={() => handleMouseDown("left")}
            onMouseUp={() => handleMouseUp("left")}
            onTouchStart={(e) => handleTouchStart(e, "left")}
            onTouchEnd={(e) => handleTouchEnd(e, "left")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowLeft className="w-6 h-6" />
          </button>

          <button
            id="stop"
            onClick={handleStopClick}
            disabled={!isConnected}
            className={`control-btn bg-red-500 hover:bg-red-600 text-white ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <Square className="w-6 h-6" />
          </button>

          <button
            id="right"
            onMouseDown={() => handleMouseDown("right")}
            onMouseUp={() => handleMouseUp("right")}
            onTouchStart={(e) => handleTouchStart(e, "right")}
            onTouchEnd={(e) => handleTouchEnd(e, "right")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowRight className="w-6 h-6" />
          </button>

          {/* Row 3 */}
          <div></div>
          <button
            id="backward"
            onMouseDown={() => handleMouseDown("backward")}
            onMouseUp={() => handleMouseUp("backward")}
            onTouchStart={(e) => handleTouchStart(e, "backward")}
            onTouchEnd={(e) => handleTouchEnd(e, "backward")}
            disabled={!isConnected}
            className={`control-btn ${!isConnected && "opacity-50 cursor-not-allowed"}`}
          >
            <ArrowDown className="w-6 h-6" />
          </button>
          <div></div>
        </div>

        {/* Connection Status */}
        <div className="mt-6 flex flex-col items-center gap-1">
          {isConnected ? (
            <div className="flex items-center gap-2 text-sm text-green-600 font-medium">
              <div className="w-2 h-2 rounded-full bg-green-500 animate-pulse"></div>
              Connected
            </div>
          ) : (
            <div className="flex items-center gap-2 text-sm text-yellow-600 font-medium">
              <AlertTriangle size={16} />
              Vehicle not connected
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default ControlPanel;
